import React, { Component } from "react";
import Card from "../Card/Card";
import "/estilos.css"

class Visitante extends Component {
    constructor(props){
        super(props)
    }

    render() {
        console.log('props no visitante',this.props)

        return (
            <section className={this.props.classe} key={this.props.cartas.id}>

                <Card

                    bandeira={this.props.cartas.bandeira}
                    id={this.props.cartas.id}
                    país={this.props.cartas.país} idh={this.props.cartas.idh} exp={this.props.cartas.exp} />
            </section>
        )
    }
    

}

export default Visitante;
